import React from "react";
import { useState } from "react";
import { useSelector, useDispach } from "react-redux";
import { bindActionCreators } from "redux";
import { actionCreators } from "./state/action-creators";

export default function UserSetup() {
  const [tempUser, setTempUser] = useState("");
  const dispatch = useDispach();
  const { setUsername, resetUser } = bindActionCreators(
    actionCreators,
    dispatch
  );
  const setupUser = () => {
    console.log(tempUser);
  };
  return (
    <div classNameName="flex justify-center items-center h-screen w-screen text-white">
      <div classNameName="flex bg-white rounded h-1/5">
        <h1 classNameName="text-black">HANGMAN</h1>
        <input
          type="text"
          placeholder="username"
          onChange={(e) => setTempUser(e.target.value)}
        ></input>
        <button classNameName="bg-black" onClick={setupUser}>
          start game
        </button>
      </div>
    </div>
  );
}

